import React, { useState, useEffect } from "react";
import ContributionChart from "../components/ContributionChart";
import { fetchContributions } from "../services/githubService";

function Dashboard() {
  const [contributions, setContributions] = useState([]);

  useEffect(() => {
    const loadContributions = async () => {
      const data = await fetchContributions("HWAI-CST"); // Replace with your organization name
      setContributions(data);
    };
    loadContributions();
  }, []);

  return (
    <div>
      <h1>GitHub Contributions Dashboard</h1>
      {contributions.length > 0 ? (
        <ContributionChart data={contributions} />
      ) : (
        <p>Loading contributions...</p>
      )}
    </div>
  );
}

export default Dashboard;
